// import logo from './logo.svg';
import transparentLogo from './assets/globeboarding-transparent.png'
import mountain from './assets/background-mountain.mp4'
import './App.css';

function App() {

  let mountainVideo =     
  <video autoPlay loop muted class="bkgrnd-vid"> 
    <source src={mountain} type="video/mp4" />
  </video>

  let globeboardingImage = <img src={transparentLogo} alt='logo' class="brand-img"/>

  let headerPage =       
  <header className="App-header">
    {mountainVideo}
    {globeboardingImage}
    <p>
      Edit <code>src/App.js</code> and save to reload. yo
    </p>
    <a
      className="App-link"
      href="https://reactjs.org"
      target="_blank"
      rel="noopener noreferrer"
    >
      Learn React
    </a>
</header>

let bodyPage =  
<body> 
  <h1>Globeboarding</h1>
</body>


  return (
    <div className="App">
        {headerPage}
        {bodyPage}
    </div>
  );
}

export default App;
